import { Component } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-register-to-landlord',
  templateUrl: './register-to-landlord.component.html',
  styleUrls: ['./register-to-landlord.component.css']
})
export class RegisterToLandlordComponent {

  registerForm!: FormGroup;
  message = '';
  error = '';

  constructor(private fb: FormBuilder, private http: HttpClient) {
    this.registerForm = this.fb.group({
      tenantFullName: ['', Validators.required],
      username: ['', Validators.required],
      tenantEmail: ['', [Validators.required, Validators.email]],
      tenantPhoneNumber: ['', [Validators.required, Validators.pattern(/^[0-9]{10}$/)]],
      tenantPermanentAddress: ['', Validators.required],
      aadhaarNumber: ['', [Validators.required, Validators.pattern(/^\d{12}$/)]],
      panCardNumber: ['', [Validators.required, Validators.pattern(/^[A-Z]{5}[0-9]{4}[A-Z]{1}$/)]],
      landlordCode: ['', Validators.required]
    });
  }

  onSubmit(): void {
    if (this.registerForm.invalid) return;

    const token = localStorage.getItem('token');
    const username = localStorage.getItem('username');

    const headers = new HttpHeaders({
      Authorization: `Bearer ${token}`,
      username: username || ''
    });

    this.http.post<any>(
      'http://localhost:8080/api/tenant/register-to-landlord',
      this.registerForm.value,
      { headers }
    ).subscribe({
      next: (res) => {
        this.message = res.message;
        this.error = '';
        this.registerForm.reset();
      },
      error: (err) => {
        this.message = '';
        this.error = err.error?.error || 'Something went wrong';
      }
    });
  }
}
<div class="register-bg">
  <div class="register-container">
    <h2>Register to Landlord</h2>

    <form [formGroup]="registerForm" (ngSubmit)="onSubmit()">
      <div class="form-row">
        <input type="text" formControlName="tenantFullName" placeholder="Full Name" />
      </div>

      <div class="form-row">
        <input type="text" formControlName="username" placeholder="Username" />
      </div>

      <div class="form-row">
        <input type="email" formControlName="tenantEmail" placeholder="Email" />
      </div>

      <div class="form-row">
        <input type="text" formControlName="tenantPhoneNumber" placeholder="Phone Number" />
      </div>

      <div class="form-row">
        <textarea formControlName="tenantPermanentAddress" placeholder="Permanent Address"></textarea>
      </div>

      <div class="form-row">
        <input type="text" formControlName="aadhaarNumber" placeholder="Aadhaar Number" />
      </div>

      <div class="form-row">
        <input type="text" formControlName="panCardNumber" placeholder="PAN Card Number" />
      </div>

      <div class="form-row">
        <input type="text" formControlName="landlordCode" placeholder="Landlord Code" />
      </div>

      <button type="submit" [disabled]="registerForm.invalid">Register</button>
    </form>

    <div class="message" *ngIf="message" [ngClass]="{'success': !error, 'error': error}">
      {{ message || error }}
    </div>
  </div>
</div>
